import React from 'react';
import ReportForm from './components/ReportForm';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Site Visit Report App by Larry</h1>
      </header>
      <ReportForm />
    </div>
  );
}

export default App;
